import React, { useState, useEffect } from "react";
import { axiosInstance, getAuthToken } from "../api/endpoint";

const PatientDashboard = () => {
  const [user, setUser] = useState(null);
  const [dossiers, setDossiers] = useState([]);
  const [loadingUser, setLoadingUser] = useState(true);
  const [loadingDossiers, setLoadingDossiers] = useState(true);
  const [errorUser, setErrorUser] = useState(null);
  const [errorDossiers, setErrorDossiers] = useState(null);

  // Récupérer infos patient
  useEffect(() => {
    const fetchUser = async () => {
      try {
        const token = getAuthToken();
        const res = await axiosInstance.get("/users/me", {
          headers: { Authorization: `Bearer ${token}` }
        });
        setUser(res.data);
      } catch (err) {
        console.error("Erreur récupération infos patient :", err);
        setErrorUser(err.response?.data?.message || "Erreur serveur");
      } finally {
        setLoadingUser(false);
      }
    };
    fetchUser();
  }, []);

  // Récupérer dossiers du patient
  useEffect(() => {
    const fetchDossiers = async () => {
      try {
        const token = getAuthToken();
        const res = await axiosInstance.get("/patient/dossiers", {
          headers: { Authorization: `Bearer ${token}` }
        });
        setDossiers(res.data);
      } catch (err) {
        console.error("Erreur récupération dossiers :", err);
        setErrorDossiers(err.response?.data?.message || "Erreur serveur");
      } finally {
        setLoadingDossiers(false);
      }
    };
    fetchDossiers();
  }, []);

  if (loadingUser) return <p>Chargement des informations patient...</p>;
  if (errorUser) return <p style={{ color: "red" }}>Erreur : {errorUser}</p>;

  return (
    <div style={{ padding: "20px" }}>
      <h2>Bienvenue, {user.fullName}</h2>
      <p>Email : {user.email}</p>

      <h3 style={{ marginTop: "30px" }}>Mes Dossiers Médicaux</h3>
      {loadingDossiers ? (
        <p>Chargement des dossiers...</p>
      ) : errorDossiers ? (
        <p style={{ color: "red" }}>Erreur : {errorDossiers}</p>
      ) : dossiers.length === 0 ? (
        <p>Aucun dossier trouvé.</p>
      ) : (
        <table
          border="1"
          cellPadding="8"
          cellSpacing="0"
          style={{ width: "100%", marginTop: "20px" }}
        >
          <thead>
            <tr>
              <th>Médecin</th>
              <th>Groupe Sanguin</th>
              <th>Résumé Médical</th>
              <th>Antécédents</th>
              <th>Allergies</th>
              <th>Contact d'Urgence</th>
              <th>Statut</th>
            </tr>
          </thead>
          <tbody>
            {dossiers.map((dossier) => (
              <tr key={dossier._id}>
                <td>{dossier.medecin?.fullName || "N/A"}</td>
                <td>{dossier.groupeSanguin || "N/A"}</td>
                <td>{dossier.resumeMedical || "N/A"}</td>
                <td>
                  {dossier.antecedents?.length
                    ? dossier.antecedents.map(a => a.libelle).join(", ")
                    : "Aucun"}
                </td>
                <td>
                  {dossier.allergies?.length
                    ? dossier.allergies.map(a => a.libelle).join(", ")
                    : "Aucune"}
                </td>
                <td>
                  {dossier.contactUrgence
                    ? `${dossier.contactUrgence.nom} (${dossier.contactUrgence.lien}) - ${dossier.contactUrgence.telephone}`
                    : "N/A"}
                </td>
                <td>{dossier.statut || "ACTIF"}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default PatientDashboard;
